import React, { useState } from 'react';
import styled from 'styled-components';
import './css/styles-game.css';
import './css/styles.css';
import Menu from './CatApp/CatApp_UI_Components/Menu';

const CatApp = () => {

    const FontContainer = styled.div`
        font-family: 'Varela Round', sans-serif;
    `;

    return (
        <FontContainer>
            <div id="game-window" style={{ marginTop: '100px' }}>
                <div id="cat-container">
                    <div id="cat-notifications"></div>
                    <img id="game-background" src="/imgs/Yard Window.png" draggable="false" alt=""/>
                    <div id="cat-info">
                        <div id="cat-info-updates"></div>
                        <Menu></Menu>
                    </div>
                </div>
            </div>
        </FontContainer>

  );
};

export default CatApp;
